import React from 'react';
import ReactDOM from 'react-dom';
import { CalenderContextProvider } from './Context/calender.context';
import CountdownTimer from './components/CountdownTimer'; // Adjust the path if necessary
import Nav from './containers/navbar/App.jsx';

const rootElement = document.getElementById('body');

ReactDOM.render(
  <React.Fragment>
    <CalenderContextProvider>
      <Nav />
      {/* Add the CountdownTimer component below Nav */}
      <CountdownTimer />
    </CalenderContextProvider>
  </React.Fragment>,
  rootElement
);
